import React from "react"

class Login extends React.Component {
    render() {
    return (
        <div>
            <form>
                <input placeholder="Email"></input>
                <br></br><br><br></br></br>
                <input placeholder="Nickname"></input>

                <button>Login</button>
            </form>
        </div>
    )
    }
}

export default Login
